定番のムーンアイズ レーシング ディビジョンのウインドブレーカー。<br><br>

レース観戦中、急に寒くなった！<br>なんて時に、荷物にならないウインドブレーカーは便利。<br><br>

Mサイズ：胸囲114cm 着丈70cm 肩幅44cm 袖丈64cm<br> 
Lサイズ：胸囲122cm 着丈73cm 肩幅54cm 袖丈66cm<br>
XLサイズ：胸囲134cm 着丈75cm 肩幅60cm 袖丈68cm<br><br>


裏地付きです。<br><br>

裏地素材：ポリエステル フランネル<style type="text/css">
